import React, { useState, useEffect } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  Grid,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Typography,
  Button,
  LinearProgress,
  Alert,
  Box,
  Container,
} from '@mui/material';
import { studyActivitiesAPI } from '../services/api';

// Default image as base64 SVG for better placeholder
const defaultImage = 'data:image/svg+xml;base64,';

function StudyActivities() {
  const [activities, setActivities] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    let mounted = true;

    const fetchActivities = async () => {
      try {
        const response = await studyActivitiesAPI.getAll();
        if (mounted) {
          setActivities(response.data || []);
          setError(null);
        }
      } catch (error) {
        if (mounted) {
          console.error('Error fetching study activities:', error);
          setError('Failed to load study activities. Please try again later.');
          setActivities([]);
        }
      } finally {
        if (mounted) {
          setLoading(false);
        }
      }
    };

    fetchActivities();

    return () => {
      mounted = false;
    };
  }, []);

  if (loading) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4 }}>
        <LinearProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4 }}>
        <Alert severity="error">{error}</Alert>
      </Container>
    );
  }

  if (!activities.length) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4 }}>
        <Alert severity="info">No study activities available.</Alert>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={4}>
        {activities.map((activity) => (
          <Grid item xs={12} sm={6} md={4} key={activity.id}>
            <Card 
              sx={{ 
                height: '100%', 
                display: 'flex', 
                flexDirection: 'column',
                transition: 'transform 0.2s, box-shadow 0.2s',
                '&:hover': {
                  transform: 'translateY(-4px)',
                  boxShadow: 4,
                },
              }}
            >
              <CardMedia
                component="img"
                height="140"
                image={activity.image_url}
                alt={activity.name}
                onError={(e) => {
                  if (e.target.src !== defaultImage) {
                    e.target.src = defaultImage;
                  }
                }}
                sx={{
                  backgroundColor: '#f5f5f5',
                  objectFit: 'cover',
                }}
              />
              <CardContent sx={{ flexGrow: 1, pb: 1 }}>
                <Typography gutterBottom variant="h5" component="h2" sx={{ mb: 1 }}>
                  {activity.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {activity.description}
                </Typography>
              </CardContent>
              <CardActions sx={{ p: 2, pt: 0 }}>
                <Button
                  variant="contained"
                  color="primary"
                  size="medium"
                  component={RouterLink}
                  to={`/study/${activity.id}`}
                  sx={{ mr: 1 }}
                >
                  LAUNCH
                </Button>
                <Button
                  variant="outlined"
                  size="medium"
                  component={RouterLink}
                  to={`/study/${activity.id}/details`}
                >
                  VIEW DETAILS
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default StudyActivities;
